    uint256 public maxSupplyForPresale = 300;
    uint256 public maxSupplyForPublicSale = maxSupply - maxSupplyForPresale;
    uint256 public maxMintAmount = 1;
    //uint256 public nftPerWhitelistAddressLimit = 1;
    //uint256 public nftPerOGAddressLimit = 2;
    bool public paused = false;
    bool public revealed = false;
    bool public onlyPresale = true;

    address[] private whitelistaddr;

    mapping(address => bool) whitelistedAddresses;
    mapping(address => uint256) public addressMintedBalance;

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _initBaseURI,
        string memory _initNotRevealedUri
    ) ERC721(_name, _symbol) {
        setBaseURI(_initBaseURI);
        setNotRevealedURI(_initNotRevealedUri);
    }

    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    // public
    function mint(uint256 _mintAmount) public payable {
        require(!paused, "the contract is paused");
        uint256 supply = totalSupply();
        require(_mintAmount == maxMintAmount, "1 NFT allowed per address");
        require(supply + _mintAmount <= maxSupplyForPublicSale, "max NFT limit exceeded");
        // require(supply + _mintAmount <= maxSupply - reserved, "max NFT limit exceeded");

        if (msg.sender != owner()) {
            require(
            whitelistedAddresses[msg.sender] == false,
            "Address already whitelisted!"
            );
            require(!onlyPresale, "Presale is on");
            require(_mintAmount == maxMintAmount, "max mint amount per session exceeded");
            require(msg.value >= costofPublicSale * _mintAmount, "insufficient funds");
        }

        for (uint256 i = 1; i <= _mintAmount; i++) {
            addressMintedBalance[msg.sender]++;
            _safeMint(msg.sender, supply + i);
        }
    }

    function whitelistMint(
        uint256 _mintAmount
    ) public payable 
    {
        require(!paused, "the contract is paused");
        require(onlyPresale, "Presale has been finished");
        uint256 supply = totalSupply();
        require(_mintAmount == maxMintAmount, "1 NFT per address allowed to mint");
        require(supply + _mintAmount <= maxSupplyForPresale, "max NFT limit for presale exceeded");

        uint256 ownerMintedCount = addressMintedBalance[msg.sender];

        require(
                ownerMintedCount + _mintAmount <= maxMintAmount,
                "max NFT per whitelist address exceeded"
            );

        // Check if user is whitelisted
        require(
            whitelistedAddresses[msg.sender] == true,
            "Whitelist: You need to be whitelisted"
            );

        require(msg.value >= costofPresale * _mintAmount, "insufficient funds");

        for (uint256 i = 1; i <= _mintAmount; i++) {
            addressMintedBalance[msg.sender]++;
            _safeMint(msg.sender, supply + i);
        }
    }

    function addwhitelistaddresses(address[] calldata _WL) external onlyOwner {
        for( uint i = 0; i < _WL.length; i++) 
        {
          whitelistedAddresses[_WL[i]] = true;
          whitelistaddr.push(_WL[i]);
        }
    }

    function walletOfOwner(address _owner) public view returns (uint256[] memory) {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIds;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        if (revealed == false) {
            return notRevealedUri;
        }

        string memory currentBaseURI = _baseURI();
        return
            bytes(currentBaseURI).length > 0
                ? string(abi.encodePacked(currentBaseURI, tokenId.toString(), baseExtension))
                : "";
    }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function setNotRevealedURI(string memory _notRevealedURI) public onlyOwner {
        notRevealedUri = _notRevealedURI;
    }

    function setBaseExtension(string memory _newBaseExtension) public onlyOwner {
        baseExtension = _newBaseExtension;
    }

    function reveal() public onlyOwner {
        revealed = true;
    }

    function setmaxMintAmount(uint256 _newmaxMintAmount) public onlyOwner {
        maxMintAmount = _newmaxMintAmount;
    }

    function pause(bool _state) public onlyOwner {
        paused = _state;
    }

    function setOnlyPresale(bool _state) public onlyOwner {
        onlyPresale = _state;
    }

    function withdraw() public payable onlyOwner {
        (bool os, ) = payable(owner()).call{value: address(this).balance}("");
        require(os);
    }
}

